import React, { Component } from 'react'

export default class Registration extends Component {
    constructor(props){
        super(props)
        this.state={
            First_Name:'',
            Last_Name:'',
            DOB:'',
            Country:'',
            Nationality:'',
            E

        }  
    }
    handleSubmit(event){
        event.preventDefault();
        fetch('https://localhost:44385/api/Registration/Create',
        {
            method:'POST',
            headers:{
                'Accept':'application/json',
                'Content-Type':'application/json'
            },
            body:JSON.stringify({
                First_Name:event.target.First_Name.value,
                Last_Name:event.target.Last_Name.value,
                DOB:event.target.DOB.value,
                Country:event.target.Country.value,
                Nationality:event.target.Nationality.value,
                Email:event.target.Email.value,
                Alternate_Email:event.target.Alternate_Email.value,
                Phone_no:event.target.Phone_no.value,
                Password:event.target.Passwordassword.value

            })
            
        })
        .then(res=>res.jSON())
        .then((result)=>{
           console.log("addedd")
        },
        (error)=>{
            alert('Failed')
        }
        )
    }
    
    render() {
        return (
            <div className="comtainer">
                <h2>Login Page</h2>
                <form onSubmit={this.handleSubmit}></form>
                <label>First_Name</label>
                <input type="text" name="First_Name" />
                <label>Last_Name</label>
                <input type="text" name="Last_Name" />
                <label>DOB</label>
                <input type="text" name="DOB" />
                <label>Country</label>
                <input type="text" name="Country" />
                <label>Nationality</label>
                <input type="text" name="Nationality" />
                <label>Email</label>
                <input type="text" name="Email" />
                <label>Alternate_Email</label>
                <input type="text" name="Alternate_Email" />
                <label>Phone_no</label>
                <input type="text" name="Phone_no" />
                <label>Password</label>
                <input type="text" name="Password"/>
                <button type="submit"  className="btn btn-danger">submit</button> 
                
                      </div>
                );
                }
                }
